const interests = `confined his shutters. Delightful as 
                  he it acceptance an solicitude discretion reasonably. 
                  Carriage we husbands advanced an perceive greatest. `


export default function Interest(){
    return(
        <div>
            <div className="interest">
                <h2>Interests</h2>
                <p>{interests}
                </p>
            </div>
        </div>
    )
}
